      <Space>
      <Sider style={{background: 'orange', width: '400px'}}>Sider4</Sider>
      <Layout>
        <Header style={{background: 'green'}}>Header4</Header>
        <Content>Content4</Content>
        <Footer>Footer4</Footer>
      </Layout>
      <Sider style={{background: 'orange'}}>Sider4</Sider>
      </Space>
    </Layout>  
    </div>
  );
}
export default App;
